import React from 'react'
import {developer} from "../images/developer.png"
import Common from "./Common"
const Home = () => {
  return (
    <div>
      <Common title="Grow your business with" name="Mohit Technical" desc="We are team of talented developer making websites" btn-text imgURL={developer}/>
    </div>
  )
}

export default Home
